-- ----------------------------
-- View structure for v_bid_vendor
-- ----------------------------
DROP VIEW IF EXISTS `v_bid_vendor`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `v_bid_vendor` AS SELECT
	p.vendor_id,
	vendor_name,
	product_code,
	product_name,
CASE	
	WHEN fin_class = 'K' THEN
	'Small' 
	WHEN fin_class = 'M' THEN
	'Medium' ELSE 'Big' 
	END AS class 
FROM
	vendor_product p
JOIN vendor v ON v.vendor_id = p.vendor_id ;

-- ----------------------------
-- View structure for v_todo
