DROP VIEW IF EXISTS `v_todo`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `v_todo` AS SELECT
	* 
FROM
	v_todo_req UNION ALL
SELECT
	* 
FROM
	v_todo_prc UNION ALL
SELECT
	* 
FROM
	v_todo_ord ;

-- ----------------------------
-- View structure for v_todo_bid
-- ----------------------------
DROP VIEW IF EXISTS `v_todo_bid`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `v_todo_bid` AS SELECT
	prv_id as todo_id,
	vendor_name,
	v.prc_number as number,
	vendor_id,
	prv_process as process,
	proc_name as "name",
	'bid' as category
FROM
	prc_vendor v
	left join prc_header p on p.prc_number = v.prc_number
	left join vendor on vendor_id = prv_vnd_id
	where now() > bid_open and now() < bid_close  and pid = 22 ;

-- ----------------------------
-- View structure for v_todo_nego
-- ----------------------------
DROP VIEW IF EXISTS `v_todo_nego`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `v_todo_nego` AS SELECT
	prv_id as todo_id,
	vendor_name,
	v.prc_number as number,
	vendor_id,
	prv_process as process,
	proc_name as "name",
	'nego' as category
FROM
	prc_vendor v
	left join prc_header p on p.prc_number = v.prc_number
	left join vendor on vendor_id = prv_vnd_id
	where v.prv_nego is not null and pid = 23 ;

-- ----------------------------
-- View structure for v_todo_ord
-- ----------------------------
DROP VIEW IF EXISTS `v_todo_ord`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `v_todo_ord` AS SELECT
	orh_id as hist_id,
	ord_history.ord_number as number,
	proc_name as "name",
	pid_name,
	orh_role as role,
	'process_ord' as category
FROM
	ord_history
	JOIN ord_header ON ord_header.ord_number = ord_history.ord_number
	JOIN process_flow ON process_flow.pid = ord_history.orh_pid 
WHERE
	orh_name IS NULL ;

