-- ----------------------------
-- View structure for v_todo_shp
-- ----------------------------
DROP VIEW IF EXISTS `v_todo_shp`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `v_todo_shp` AS SELECT
	orh_id as todo_id,
	ord_history.ord_number as number,
	proc_name as "name",
	pid_name as process,
	orh_role as role,
	'process_ord' as category,
	vnd_name as vendor_name,
	vnd_id as vendor_id
FROM
	ord_history
	JOIN ord_header ON ord_header.ord_number = ord_history.ord_number
	JOIN process_flow ON process_flow.pid = ord_history.orh_pid 
WHERE
	orh_role = 'VENDOR' and orh_name IS NULL ;

